import React from 'react';

const RegisterPage = () => {
  return (
    <div>
      <h2>Register</h2>
      <form>
        <label>Username : <input type="text" /></label><br></br><br></br>
        <label> Password : <input type="password" /></label><br></br><br></br>
        <a href="LoginPage.js">Register</a>
      </form>
    </div>
  );
};

export default RegisterPage;
